// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

library NumberToString { 
    uint8 private constant ASCII_Zero = 48;
    function toString(uint256 value) public pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits--;
            buffer[digits] = bytes1(uint8(ASCII_Zero + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }
}
